// import { useState, useEffect } from 'react'
import './App.css';


function getExper(){
  fetch('/exp/1/200/hyper')
  .then(response => response.json())
  .then(data => console.log(data));
}

function App() {

  return (
    <div className="App">
      <button onClick={getExp}>

      Exp me!
    </button>

    <button onClick={getExper}>

        Exper me!
      </button>
    </div>
  );
}

export default App;
